import React from "react";
import "./PhotoFrame.css";

const frameLayouts = {
  spam_frame: [
    { width: 500, height: 700, top: 125, left: 88 },
    { width: 500, height: 700, top: 125, left: 612 },
    { width: 500, height: 700, top: 849, left: 88 },
    { width: 500, height: 700, top: 849, left: 612 },
  ],
  mabear_frame: [
    { width: 512, height: 612, top: 406, left: 63 },
    { width: 512, height: 612, top: 137, left: 626 },
    { width: 512, height: 612, top: 1050, left: 63 },
    { width: 512, height: 612, top: 781, left: 626 },
  ],
  cheese_frame: [
    { width: 512, height: 612, top: 406, left: 63 },
    { width: 512, height: 612, top: 137, left: 626 },
    { width: 512, height: 612, top: 1050, left: 63 },
    { width: 512, height: 612, top: 781, left: 626 },
  ],
  yohan_frame: [
    { width: 512, height: 612, top: 406, left: 63 },
    { width: 512, height: 612, top: 137, left: 626 },
    { width: 512, height: 612, top: 1050, left: 63 },
    { width: 512, height: 612, top: 781, left: 626 },
  ],
  park_frame: [
    { width: 527, height: 352, top: 50, left: 47 },
    { width: 527, height: 352, top: 426.765, left: 47 },
    { width: 527, height: 352, top: 803.555, left: 47 },
    { width: 527, height: 352, top: 1180.345, left: 47 },
  ],
};

const PhotoFrame = ({ photos, frameType }) => {
  const layouts = frameLayouts[frameType] || [];

  return (
    <div
      className="photo-frame-container"
      style={{ position: "relative", width: "1122px", height: "1500px" }}
    >
      {/* 촬영된 사진들을 배경으로 렌더링 */}
      {photos.map((photo, index) => (
        <img
          key={index}
          src={photo}
          alt={`사진 ${index + 1}`}
          className="photo"
          style={{
            width: layouts[index]?.width,
            height: layouts[index]?.height,
            top: layouts[index]?.top,
            left: layouts[index]?.left,
            position: "absolute",
            objectFit: "cover", // 사진이 레이아웃에 정확히 맞도록
          }}
        />
      ))}
      {/* 프레임 이미지 오버레이 */}
      <img
        src={`/${frameType}.png`}
        alt="프레임 이미지"
        className="frame-overlay"
        style={{
          width: "1200px", // 프레임 이미지의 전체 너비
          height: "1800px", // 프레임 이미지의 전체 높이
          position: "absolute",
          top: 0,
          left: 0,
          zIndex: 10, // 프레임 이미지를 사진 위에 올림
          pointerEvents: "none", // 프레임 이미지 클릭 불가능하게 설정
        }}
      />
    </div>
  );
};

export default PhotoFrame;
